import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import "../../css/Doctor/ddashboard.css";

export default function UploadSchedule() {
  const getNextDates = () => {
    const today = new Date();
    const dates = [];

    for (let i = 0; i < 7; i++) {
      const nextDate = new Date(today);
      nextDate.setDate(today.getDate() + i);
      dates.push(nextDate.toISOString().split('T')[0]);
    }

    return dates;
  };
  // Define dummy schedule data
  const dummySchedule = {
    "slots": [
      [2024, 4, 5, 11, 15],
      [2024, 4, 6, 15, 45],
      [2024, 4, 7, 15, 0],
      [2024, 4, 2, 15, 45],
      [2024, 4, 5, 15, 0]
    ],
    "appointments": [
      { id:1, date: getNextDates()[0], time: '09:00', patientName: 'John Doe' },
      { id:2, date: getNextDates()[4], time: '10:30', patientName: 'somebody someone' },
      { id:3, date: getNextDates()[1], time: '11:15', patientName: 'Alice Smith' },
      { id:4, date: getNextDates()[3], time: '12:00', patientName: 'Bob Johnson' },
      { id:5, date: getNextDates()[5], time: '09:00', patientName: 'John Doe' }
    ]
  };

  // State for schedule data
  const [schedule, setSchedule] = useState({ slots: [], appointments: [] });

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  useEffect(() => {
    // Initialize schedule with dummy data
    setSchedule(dummySchedule);
  }, []);

  // Function to get next dates (for dummy data)


  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Function to generate slots with availability color coding
  const generateSlots = () => {
    const slots = [];
    for (let i = 9; i < 16; i++) {
      for (let j = 0; j < 60; j += 45) {
        const time = `${i < 10 ? '0' + i : i}:${j === 0 ? '00' : j}`;
        const isSlotAvailable = schedule.slots.some(slot => slot[3] === i && slot[4] === j);
        const isSlotBooked = schedule.appointments.some(appointment => appointment.time === time);
        slots.push(
          <td
            key={time}
            className={getClassForSlot(isSlotAvailable, isSlotBooked)}
            onClick={() => handleSlotClick(time)}
          ></td>
        );
      }
    }
    return slots;
  };

  // Function to handle slot click
  const handleSlotClick = (time) => {
    // Logic to handle slot click when editing mode is enabled
  };

  // Function to get CSS class for slot based on availability
  const getClassForSlot = (isAvailable, isBooked) => {
    if (isBooked) return 'table-danger bg-danger text-dark';
    if (isAvailable) return 'table-success bg-success text-white';
    return 'table-secondary bg-secondary text-white';
  };

  return (
    <div className='dashboard-container'>
      <Navbar />
      <div className='dashboard-content'>
        <SideNavbar />
        <div className="main-content">
          <h2>This week's Schedule</h2>
          <table className="table table-bordered custom-box khus">
            <thead>
              <tr>
                <th></th>
                <th>9:00 AM</th>
                <th>9:45 AM</th>
                <th>10:30 AM</th>
                <th>11:15 AM</th>
                <th>12:00 PM</th>
                <th>12:45 PM</th>
                <th>01:30 PM</th>
                <th>02:15 PM</th>
                <th>03:00 PM</th>
                <th>03:45 PM</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <th scope="row">Date</th>
                {generateSlots()}
              </tr>
            </tbody>
          </table>

          <button type="button" className="btn btn-primary custom-button" onClick={handleEdit}>
            {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
          </button>
          {isEditing && (
            <button type="button" className="btn btn-primary custom-button" onClick={handleSubmit}>
              Submit
            </button>
          )}
        </div>
      </div>
    </div>
  );
}
